import React from "react";
import { server } from "../../lib/api";


const LISTINGS = `
    query Listings {
        listings {
            id 
            title
            image 
            address
            price 
            numOfGuests
        }
    }
`;


interface Props {
  title: string;
}

export const Listings = ({ title }: Props) => {
    const fetchListings = () => {
        const listings = server.fetch();
    }
  return (
    <div>
      <h2>{title}</h2>
      <button onClick= {fetchListings}> Query Listings!</button>
    </div>
  );
};
